import React from 'react';
import { Link } from 'react-router-dom'

const HistorySummary = ({ historyData, props }) => {
    // console.log('Hello', historyData);
    return (
        <React-fragment>
            {historyData.id === props.auth.uid && <div style={{ overflow: 'auto' }}>
                <Link to={'/'}>
                    <span>{historyData.method} </span>
                </Link>
                <span>{historyData.url}</span>
            </div>}
        </React-fragment>
    );
};

export default HistorySummary;
